import React from "react";
import { Heading, Container, Center, VStack, HStack, Box } from "@chakra-ui/react";
import SkillTile from "./skillTile";

const Skills = () => {
    return (
        <Center bg='blue.600' maxWidth='100%' h='100vh'>
            <Container>
                <Heading as='h2' size='2xl' textAlign='center'>
                    some things i know
                </Heading>
                <VStack>
                    <HStack>
                        <SkillTile props={{skillName: 'HTML'}} />
                    </HStack>
                </VStack>
            </Container>
        </Center>
    )
}

export default Skills
